import React, { Component } from "react";
import "./styles.scss";

class join extends Component {
  render() {
    return (
      <div className="container-fluid p-0" id="join-login">
        <div className="container join-content">
          <h1>JOIN GIGABYTE AORUS MEMBERSHIP</h1>
        </div>
      </div>
    );
  }
}

export default join;
